import React from 'react';
import NewGameButton from './NewGameButton'
import Game from './Game'
import questions from './data'

class App extends React.Component {
  state={
    questions: []
  }

  componentDidMount(){
    fetch()
  }

  render(){
    return (
      <div>
        <h1>Lutrivia</h1>
        <NewGameButton />
        <Game questions={this.state.questions.slice(0, 3)}/>
      </div>
    );
  }
}

export default App;
